			<description><![CDATA[Hey guys, first mapping ive ever released, I needed a Rehabilitation Centre and some new housing so I decided to make this, figured you guys might want it too.<br />
<br />
<br />
<br />
<div align="center"><img alt="" border="0" src="https://i.imgur.com/RflaPsY.jpg"/></div>
The two Rehab Houses are Interior Mapped, you can modify this however you like.<br />
<br />
Carparking and Medical Centre next to Rehab Facility, lots of vegetation, plenty of Buildings.<br />
<br />
ALL Fences and little posts are unbreakable, all Objects are solid, with the exception of a Bush and the Long Grass.<br />
<br />
<br />
